import "./InterviewExcelLineStyle.css";
import React from 'react'
import { Component } from 'react';


class InterviewExcelLine extends Component{
    render(){
      return(
        <div>
            <input
                id={id}
                type="text"
                value={value}
                class={fieldClass}
                onChange={onChange}
                validatge={validate}
                placeholder={placeholder}
            />
        </div>


        )
    }
  }
  
export default InterviewExcelLine;
